import{g as e,f as i,E as a}from"./common-d6bd45c0.js";const t='{"title":"词法分类","frontmatter":{},"headers":[{"level":2,"title":"词法分类","slug":"词法分类"},{"level":2,"title":"空白符号 Whitespace","slug":"空白符号-whitespace"},{"level":2,"title":"换行符 LineTerminator","slug":"换行符-lineterminator"},{"level":2,"title":"注释 Comment","slug":"注释-comment"},{"level":2,"title":"标识符名称 IdentifierName","slug":"标识符名称-identifiername"},{"level":2,"title":"符号 Punctuator","slug":"符号-punctuator"},{"level":2,"title":"数字直接量 NumericLiteral","slug":"数字直接量-numericliteral"},{"level":2,"title":"字符串直接量 StringLiteral","slug":"字符串直接量-stringliteral"},{"level":2,"title":"正则表达式直接量 RegularExpressionLiteral","slug":"正则表达式直接量-regularexpressionliteral"},{"level":2,"title":"字符串模板 Template","slug":"字符串模板-template"}],"relativePath":"docs/reStudy/js_token.md","lastUpdated":1636897878165.4758}';var r={};const l=a('<h2 id="词法分类"><a class="header-anchor" href="#词法分类" aria-hidden="true">#</a> 词法分类</h2><ul><li>WhiteSpace 空白字符</li><li>LineTerminator 换行符</li><li>Comment 注释</li><li>Token 词 <ul><li>IdentifierName 标识符名称，典型案例是我们使用的变量名，注意这里关键字也包含在内了。</li><li>Punctuator 符号，我们使用的运算符和大括号等符号。</li><li>NumericLiteral 数字直接量，就是我们写的数字。</li><li>StringLiteral 字符串直接量，就是我们用单引号或者双引号引起来的直接量。</li><li>Template 字符串模板，用反引号` 括起来的直接量。</li></ul></li></ul><h2 id="空白符号-whitespace"><a class="header-anchor" href="#空白符号-whitespace" aria-hidden="true">#</a> 空白符号 Whitespace</h2><blockquote><p>说起空白符号，想必给大家留下的印象就是空格，但是实际上，JavaScript 可以支持更多空白符号。</p></blockquote><p>很多公司的编码规范要求 JavaScript 源代码控制在 ASCII 范围内，那么，就只有 五种空白可用了。</p><h2 id="换行符-lineterminator"><a class="header-anchor" href="#换行符-lineterminator" aria-hidden="true">#</a> 换行符 LineTerminator</h2><p>JavaScript 中只提供了 4 种字符作为换行符:</p><ul><li>&lt; LF &gt; 是 U+000A，就是最正常换行符，在字符串中的\\n。</li><li>&lt; CR &gt; 是 U+000D，这个字符真正意义上的“回车”，在字符串中是\\r，在一部分 Windows 风格文本编辑器中，换行是两个字符\\r\\n。</li><li>&lt; LS &gt; 是 U+2028，是 Unicode 中的行分隔符。</li><li>&lt; PS &gt; 是 Unicode 中的段落分隔符。</li></ul><h2 id="注释-comment"><a class="header-anchor" href="#注释-comment" aria-hidden="true">#</a> 注释 Comment</h2><p>JavaScript 的注释分为单行注释和多行注释两种：</p><div class="language-"><pre><code>/* MultiLineCommentChars */ \n// SingleLineCommentChars\n</code></pre></div><p>除了四种 LineTerminator 之外，所有字符都可以作为单行注释。</p><h2 id="标识符名称-identifiername"><a class="header-anchor" href="#标识符名称-identifiername" aria-hidden="true">#</a> 标识符名称 IdentifierName</h2><p>IdentifierName可以以美元符“$”、下划线“_”或者 Unicode 字母开始，除了开始字符以外，IdentifierName中还可以使用 Unicode 中的连接标记、数字、以及连接符号。也就是变量名</p><p>IdentifierName的任意字符可以使用 JavaScript 的 Unicode 转义写法，使用 Unicode 转义写法时，没有任何字符限制。</p><p>IdentifierName可以是Identifier、NullLiteral、BooleanLiteral或者keyword，在ObjectLiteral中，IdentifierName还可以被直接当做属性名称使用。</p><p>仅当不是保留字的时候，IdentifierName会被解析为Identifier。</p><p><strong>关键字</strong>也属于这个部分，在 JavaScript 中，关键字有:</p><div class="language-"><pre><code>await break case catch class const continue debugger default delete do else export extends finally for function if import instance of new return super switch this throw try typeof var void while with yield\n</code></pre></div><p>除了上述的内容之外，还有 1 个为了未来使用而保留的关键字:enum</p><p>在严格模式下, 有一些额外的为未来使用而保留的关键字:</p><div class="language-"><pre><code>implements package protected interface private public\n</code></pre></div><p>除了这些之外，NullLiteral（null）和BooleanLiteral（true false）也是保留字，不能用于Identifier。</p><h2 id="符号-punctuator"><a class="header-anchor" href="#符号-punctuator" aria-hidden="true">#</a> 符号 Punctuator</h2><div class="language-"><pre><code>{ ( ) [ ] . ... ; , &lt; &gt; &lt;= &gt;= == != === !== + - * % ** ++ -- &lt;&lt; &gt;&gt; &gt;&gt;&gt; &amp; | ^ ! ~ &amp;&amp; || ? : = += -= *= %= **= &lt;&lt;= &gt;&gt;= &gt;&gt;&gt;= &amp;= |= ^= =&gt; / /= }\n</code></pre></div><h2 id="数字直接量-numericliteral"><a class="header-anchor" href="#数字直接量-numericliteral" aria-hidden="true">#</a> 数字直接量 NumericLiteral</h2><p>JavaScript 规范中规定的数字直接量可以支持四种写法：十进制数、二进制整数、八进制整数和十六进制整数。</p><h4 id="为什么12-tostring-会报错"><a class="header-anchor" href="#为什么12-tostring-会报错" aria-hidden="true">#</a> 为什么12.toString()会报错</h4><ol start="12"><li>会被当作省略了小数点后面部分的数字，而单独看成一个整体，所以我们要想让点单独成为一个 token，就要加入空格，这样写</li></ol><div class="language-"><pre><code>12 .toString()\n</code></pre></div><p>数字直接量还支持科学计数法，例如：</p><div class="language-"><pre><code>10.24E+2\n10.24e-2\n10.24e2\n</code></pre></div><p>这里 e 后面的部分，只允许使用整数。当以0x 0b 或者0o 开头时，表示特定进制的整数：</p><div class="language-"><pre><code>0xFA\n0o73\n0b10000\n</code></pre></div><p>上面这几种进制都不支持小数，也不支持科学计数法。</p><h2 id="字符串直接量-stringliteral"><a class="header-anchor" href="#字符串直接量-stringliteral" aria-hidden="true">#</a> 字符串直接量 StringLiteral</h2><p>JavaScript 中的 StringLiteral 支持单引号和双引号两种写法。</p><div class="language-"><pre><code>&quot; DoubleStringCharacters &quot;\n&#39; SingleStringCharacters &#39;\n</code></pre></div><p>单双引号的区别仅仅在于写法，在双引号字符串直接量中，双引号必须转义，在单引号字符串直接量中，单引号必须转义。字符串中其他必须转义的字符是\\和所有换行符。</p><h2 id="正则表达式直接量-regularexpressionliteral"><a class="header-anchor" href="#正则表达式直接量-regularexpressionliteral" aria-hidden="true">#</a> 正则表达式直接量 RegularExpressionLiteral</h2><p>正则表达式由 Body 和 Flags 两部分组成，例如：</p><div class="language-"><pre><code>/RegularExpressionBody/g\n</code></pre></div><p>其中 Body 部分至少有一个字符，第一个字符不能是 <em>（因为 /</em> 跟多行注释有词法冲突）。正则表达式有自己的语法规则，在词法阶段，仅会对它做简单解析。</p><h2 id="字符串模板-template"><a class="header-anchor" href="#字符串模板-template" aria-hidden="true">#</a> 字符串模板 Template</h2><p>模板字符串不需要关心大多数字符的转义，但是至少 ${ 和 ` 还是需要处理的。</p><div class="language-"><pre><code>`a${b}c${d}e`\n</code></pre></div>',46);r.render=function(a,t,r,n,d,o){return i(),e("div",null,[l])};export default r;export{t as __pageData};
